          className='btns'
          buttonStyle='btn--primary'
          buttonSize='btn--large'
          onClick={console.log('hey')}
        >
          Log In <i className='far fa-play-circle' />
        </Button>
      </div>
    </div>
  );
}

export default SignUp;
